import './App.css';
import React from 'react'
import Bio from './components/Bio';
import { BrowserRouter, Link, Outlet, Route, Routes } from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <header>
        <nav>
        <Link to="/bio">Bio</Link>
        </nav>
      </header>

      <h1>Pablo Picasso website</h1>

      <BrowserRouter>
        <Routes>
          <Route path='/bio' element={<Bio/>}/>
        </Routes>
      </BrowserRouter>

      <Outlet/>
    </div>
  );
}

export default App;
